export const addBill = function() {
  return fetch('https://jsonplaceholder.typicode.com/users')
    .then(resp => {
      if (resp.status === 200) {
        console.log(resp);
        return resp.json();
      } else {
        console.error('error');
      }
    })
    .then(a => console.log(a.json()));
};
